import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import {windowListener, burgerClick} from './scripts/myscripts.js';
import { useEffect } from 'react';
import $ from 'jquery';


function Menu(props) {
  const closeBurgerMenu = () => {
    console.log("HEJ");
    $('#phoneBarMenu').css('height', '0');
  };

  const handleLinkClick = (event) => {
    event.preventDefault(); // prevent the default behavior of Link
    closeBurgerMenu(); // call the closeBurgerMenu function
    props.history.push(event.target.getAttribute('href')); // navigate to the specified route
  };

  useEffect(()=>{
    windowListener();
    burgerClick();

  });
  
  return (
    <div className='container-fluid'>
      <div className='row'>
        <div className='col-12 menuBar'>
          <div id="compBar">
            <Link to="./"><button className='menuBut'>Home</button></Link>
            <Link to="./profile"><button className='menuBut'>Profile</button></Link>
            <Link to="./login"><button className='menuBut'>Create Account</button></Link>
            <Link to="./login"><button className='menuBut'>Log In</button></Link>
          </div>
          <div id="phoneBar">
            <div id="burger" >
            <div className="patty"></div>
            <div className="patty"></div>
            <div className="patty"></div>
            </div>
            <div id="phoneBarMenu" className='d-flex flex-column align-items-center'>
              <Link to="./"><button className="menuBut pt-5" onClick={closeBurgerMenu}>Home</button></Link>
              <Link to="./profile"><button className="menuBut">Profile</button></Link>
              <Link to="./login"><button className="menuBut">Create Account</button></Link>
              <Link to="./login"><button className="menuBut pb-5">Log In</button></Link>
            </div>
            </div>   
        </div>
        
      </div>
    </div>
  );
}

export default Menu;
